import Car from "./convertible-car-png.png"
const Home = () => {
    let name = 'mario';
    const handleClick = (e) => {
        console.log('hello ninjas', e);
    }


    return (
        <div className="home">
            <h2>Homepage</h2><br/>
            <p>Welcome to Pinpoint Personal Plates, within this application you can search for plates held within our system and also create and register a new plate. Please use the navigation bar to move between searching and creating a registration plate.</p>
            <img className="photo" src={Car}/>
        </div>
    );
};

export default Home;
